UKCOAAAAAAAAAAAAAAAAAAAAAAAAIAcIUEcAAAAAAAAAAAAAAAAAAAAAAAAQI6QIA4AAAAAAAAAAAAAAAAAAAAAAAAgR0gQBwAAAAAAAAAAAAAAAAAAAAAAAJAjJIgDAAAAAAAAAAAAAAAAAAAAAAAAyBESxAEAAAAAAAAAAAAAAAAAAAAAAADkCAniAAAAAAAAAAAAAAAAAAAAAAAAAHKEBHEAAAAAAAAAAAAAAAAAAAAAAAAAOUKCOAAAAAAAAAAAAAAAAAAAAAAAAIAcIUEcAAAAAAAAAAAAAAAAAAAAAAAAQI6QIA4AAAAAAAAAAAAAAAAAAAAAAAAgR0gQBwAAAAAAAAAAAAAAAAAAAAAAAJAjJIgDAAAAAAAAAAAAAAAAAAAAAAAAyBESxAEAAAAAAAAAAAAAAAAAAAAAAADkCAniAAAAAAAAAAAAAAAAAAAAAAAAAHKEBHEAAAAAAAAAAAAAAAAAAAAAAAAAOUKCOAAAAAAAAAAAAAAAAAAAAAAAAIAcIUEcAAAAAAAAAAAAAAAAAAAAAAAAQI6QIA4AAAAAAAAAAAAAAAAAAAAAAAAgR0gQBwAAAAAAAAAAAAAAAAAAAAAAAJAjJIgDAAAAAAAAAAAAAAAAAAAAAAAAyBESxAEAAAAAAAAAAAAAAAAAAAAAAADkCAniAAAAAAAAAAAAAAAAAAAAAAAAAHKEBHEAAAAAAAAAAAAAAAAAAAAAAAAAOUKCOAAAAAAAAAAAAAAAAAAAAAAAAIAcIUEcAAAAAAAAAAAAAAAAAAAAAAAAQI6QIA4AAAAAAAAAAAAAAAAAAAAAAAAgR0gQBwAAAAAAAAAAAAAAAAAAAAAAAJAjJIgDAAAAAAAAAAAAAAAAAAAAAAAAyBESxAEAAAAAAAAAAAAAAAAAAAAAAADkCAniAAAAAAAAAAAAAAAAAAAAAAAAAHKEBHEAAAAAAAAAAAAAAAAAAAAAAAAAOUKCOAAAAAAAAAAAAAAAAAAAAAAAAIAcIUEcAAAAAAAAAAAAAAAAAAAAAAAAQI6QIA4AAAAAAAAAAAAAAAAAAAAAAAAgR0gQBwAAAAAAAAAAAAAAAMD/bw8OCQAAAAAE/X/tDQMAAAAAAABMBPR/flwnacFVAAAAAElFTkSuQmCC\"/\u003e\u003c/Page\u003e\u003cPage label=\"Method\"\u003e\u003cText\u003e\u003c![CDATA[## Method]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[We use an ensemble model to calculate distances between countries based on their reviews. We preprocess the reviews, and then tokenize and vectorise the text. From these vectors we can then compute distances between different corpuses. Afterwards, we aggregate predictions from 7 models by use of a simple mean, and we also monitor the standard deviation. From these distances, we then compute a clustering using an agglomerative clustering method.  The algorithm begins with a forest of clusters that have yet to be used in the hierarchy being formed. When two clusters from this forest are combined into a single cluster, they are removed from the forest, and the new single merged cluster is added to the forest. When only one cluster remains in the forest, the algorithm stops, and this cluster becomes the root.]]\u003e\u003c/Text\u003e\u003c/Page\u003e\u003c/Pages\u003e\u003c/Report\u003e", width: "", output_is_light_prose: false };
